INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151699, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '这个不重要哦！重要的是我们把最新的贷款消息带给了您，如果您有资金需要，我们公司也可以成为您备选的解决方案之一不是很好吗？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151700, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '哦，好的', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151701, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '服务费是贷款额的两个点，直接交到银行柜台。详细的情况欢迎您来我们公司具体面谈，可以吧？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151702, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '服务费是贷款额的两个点打包，直接交到银行柜台，这个收费标准在每家银行都是透明的。', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151703, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '我们是看具体情况的，建议您来我们公司面谈一下，好吧？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151704, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '这样吧，稍后我会把具体地址通过短信发给您，您到了后我去接您，可以吧？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151705, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '那行，那我们就约周末，我先把我公司地址和我的电话发到您手机上，我周五再与您确认一下，请问怎么称呼您呢？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151706, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '是这样的，任何一家银行贷款都是需要本人带着身份证和相关资料去现场办理的。要不您加我微信，把资料通过传过来，我们先审核，确定能做的，就通知您过来，微信号码我通过短信发给您，好吧？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
