INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151708, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '哦，那我稍后先发个短信给您，上面有银行客户经理的手机号码，您方便的时候随时联系，可以吧？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151709, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '咱们贷款算利息一般讲月息，如果利息6厘，意思就是，贷款1万元，一个月利息就是60元。', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151710, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '我们这里是硅基智能，总部在南京市江宁区。', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151711, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '对，我们现在真的是利息又低，放款又快，服务又好，了解一下绝对不吃亏的，您觉得呢？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
