INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151715, null, '20190125TEM00000096154', 'yzydk_en', '一般问题', null, null, '我们有各种渠道，产品多元化，可以符合各种客户，相信我们是有办法可以给您解决资金问题的，我们可以当面沟通解决您的实际问题，您看什么时候方便呢？', '2019-01-29 13:34:26', 'test6-huashu2', null, null, null, null, null, false, null, null);
