INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151932, null, '20190125TEM00000152529', 'bmls_en', '结束', null, null, '那打扰您了,祝您生活愉快，再见！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151933, null, '20190125TEM00000152529', 'bmls_en', '强制结束', null, null, '您看我这边也是新来的，您的问题一时也无法准确答复您。稍后让我们专业的客户经理给您来电为您解答吧。那今天咱们就先这样吧，祝您生活愉快，再见', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151934, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '有啊，但是我这边只是负责商铺的，稍后我让我们专业的销售经理给您回电话做一个详细的解答吧。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151935, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '关于周边的房价没办法说，因为我们项目周边大多为二手房，根据面积、户型、楼层、位置的不同而价格不同，一般都是一房一价。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151936, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '目前我们的商铺只有大面积的了，沿街商铺是127平方，售楼处是1123平方，户型都是比较方正，开间大，展示面好。我建议您可以先来售楼处做个详细了解。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151937, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们项目公摊面积相比之下是非常小的。具体建议您过来实地查看了解一下！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151938, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '商铺层高为4.2米,售楼处一层是4.8米，二层是4米，您可以了解下哦。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151939, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '现在我们物业费是4.5元每平方，具体情况欢迎您到项目实地来了解下。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
