INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151942, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '有两种付款方式，第一是全款，第二种为贷款，首付是百分之50，具体情况让我们销售经理给您回电话做个详细的解答吧。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151943, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们项目是由金城和耀辉合作开发的，当时是浦口的神盘哦。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151944, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '如果您现在购买，我们可以给您走个团购优惠价格，现在好多团购的客户在跟我们接触，他们都是看重了我们项目有巨大的升值潜力才来的。如果您对我们项目感兴趣的话，我建议您可以先来售楼处做个详细了解。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151945, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '咱们项目已出租的商铺租金都在5元到6元每平方每天哦，非常适合投资，也适合自用，买完后出租肯定也没问题。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151946, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们项目的产权是70年的。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151947, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '商铺属于稀缺资源，目前只剩一套了，您肯定要看过之后才会决定买不买的是吧，您可以随时过来我们项目地考察的。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151948, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '您叫我小刘就可以了', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151949, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '现在不一样了呀，这个商铺靠近十字路口，旁边的路明年就能通车啦', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151950, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '老板，我是标准的90后呢。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151951, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们这个是现房，全款结清就能交付哦！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151952, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '不好意思哦，我这边是新来的，请您谅解！稍后我安排我们销售经理再跟您沟通好吧？', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151953, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '这不重要啦，主要是我们的商铺性价比确实比较高，您看什么时候有空过来看一下？', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151954, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们是电脑随机拨号码段的，也是为了您能买到更好的商铺。如果不巧打扰到您，非常抱歉了。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151955, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '哦，不好意思，您请讲！我在听', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151956, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '哦，好的。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151957, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '谢谢，我这人比较容易害羞的。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151958, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我这边是硅基售楼处的，来电是想给您介绍我们的商铺项目呢。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151959, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们项目的具体地址是在浦口区江浦街道黑马路231号，硅基销售中心，交通还是蛮方便的啊！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151960, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '商铺的总价约600万，售楼处总价约4000万。具体您可以来售楼处详细了解一下！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151961, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '好的，那我稍后先发个短信给您，顺便加下您微信，您通过下！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151962, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们周边配套是非常齐全的，对面有个大型综合体，还有万达影城入驻呢，而且周边都是高端住宅环绕，后期消费层次一定很高的。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151963, null, '20190125TEM00000152529', 'bmls_en', '一般问题', null, null, '我们停车位是足够的，地上地下都有哦，具体的情况稍后我让我们的销售经理和您详细地再介绍一下。', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151964, null, '20190125TEM00000152529', 'bmls_en', '拒绝', null, null, '其实您不用拒绝得那么快，您想啊，我们地理位置和配套设施这么好，回报率可以想象得到的，您真的可以再考虑下哦！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151965, null, '20190125TEM00000152529', 'bmls_en', '流程2_1', null, null, '我们项目呢，是金城和耀辉合作开发的，周边都是高端住宅区，对面是大型商业综合体、靠近江浦客运站和地铁十号线龙华路站，周边很繁华，交通也很方便呢！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151966, null, '20190125TEM00000152529', 'bmls_en', '开场白', null, null, '您好，我们是硅基售楼处的。现在我们在浦口有70年产权的沿街商铺和1123平方的独立商业出售，请问您有兴趣了解一下吗？', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151967, null, '20190125TEM00000152529', 'bmls_en', '解释开场白', null, null, '是这样的，我们在浦口区黑马路有最后一间127平方米的商铺和本项目的售楼处出售，您需要了解下吗？', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151968, null, '20190125TEM00000152529', 'bmls_en', '出错', null, null, '不好意思，可能信号太差了，我这边没有声音，下次再联系吧，拜拜！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151969, null, '20190125TEM00000152529', 'bmls_en', '邀约', null, null, '这样，我看您对我们的项目挺感兴趣的，稍后我让我们销售经理联系您，给您做个详细的介绍，对了，您贵姓啊？', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151970, null, '20190125TEM00000152529', 'bmls_en', '邀约', null, null, '您看这样吧，具体的细节问题呢，我让我们销售经理稍后给您回个电话再沟通一下，好吧？', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
