INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (151972, null, '20190125TEM00000152529', 'bmls_en', '结束_未匹配', null, null, '您要是有兴趣的话呢，也可以到我们项目售楼处来看一下的，毕竟这么好的项目而且是这样的稀缺，如果没有抓住实在是太可惜了，那今天就先这样，再见！', '2019-01-29 14:45:40', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152018, null, '20190125TEM00000165125', 'hldxgy_en', '未匹配响应', null, null, '不好意思哦，刚没听清，要么您再说一遍？', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152019, null, '20190125TEM00000165125', 'hldxgy_en', '未匹配响应', null, null, '您感兴趣的话，稍后我们微信上联系沟通，您看好吗？', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
