INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152034, null, '20190125TEM00000165125', 'hldxgy_en', '一般问题', null, null, '现在在卖的公寓，各个楼层都有，总共是20多层，均价XX起，也有特价房，具体是一房一价的，您可以来我们售楼处，我们给您挑房源，具体算一下价格。', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152035, null, '20190125TEM00000165125', 'hldxgy_en', '一般问题', null, null, '我们有两种付款方式，第一种是全款，第二种是贷款，贷款的首付额度最低是50%，首付款也可以分期，贷款最长可以贷10年。像您如果买一个小面积的，首付也就XX来万，很划算，剩下的收租金就可以以租养贷了。', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152036, null, '20190125TEM00000165125', 'hldxgy_en', '一般问题', null, null, '我们项目地段很好啊，离市中心只有十分钟路程，还是精装修的，而且现在租金也租的很高了，周边住宅都卖到两万多啦，性价比真的很高。另外我们是买一层送一层，单价才划到八千不到呢，现在售楼部做活动，优惠力度特别大，具体可以来售楼部详谈。', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152037, null, '20190125TEM00000165125', 'hldxgy_en', '一般问题', null, null, '我们开发商是XXXX有限公司。', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152038, null, '20190125TEM00000165125', 'hldxgy_en', '一般问题', null, null, '房子这东西又不会骗人的，您肯定要看过之后才会决定买不买的是吧，您可以随时过来咱们项目实地考察的。', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152039, null, '20190125TEM00000165125', 'hldxgy_en', '一般问题', null, null, '目前项目周边租金的话，像四十平左右的，因为是双钥匙双层空间，可以两层分开租，至少可以租到3000一个月，回报率非常高的。我们也有托管公司，如果您不想自己租，也可以委托我们商管公司帮您出租，您只需要收租金就可以了，非常省心。另外自己住也是非常合适的。', '2019-01-29 14:56:42', 'test6-huashu2', null, null, null, null, null, false, null, null);
