INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152389, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '这样吧，稍后我让我们理财经理给您发个短信，上面有联系方式和相关资料，您先看下，有问题随时沟通，好吧？', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152390, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '哦，不好意思，您请讲！我在听。', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152391, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '我们是以南京本地的信托产品为主，分为一年期和两年期，收益8%-10%，起投门槛是300万，只针对私人银行客户开放，您看您要不要考虑一下？', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152392, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '那行，您的想法我了解了，我们有符合您需要的产品的，我稍后让我们资深的理财经理联系您，具体介绍一下产品的情况，好吧?', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152393, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '那要看跟什么产品比咯，我们的收益率基本是略高于目前行业的平均水平的，因为今年整体的融资成本有所提高，因此我们给到投资人的收益略有提升。', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152394, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '我们这边是南京硅基，成立于2008年，是国内排名前五的信托公司，也是唯一一家在上交所上市的信托公司，隶属于南京银监局监管，是最受南京投资人喜欢的信托公司。', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152395, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '这样，详细情况后续安排我们资深的理财经理跟您沟通，您看可以吗？', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152396, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '我们的产品追求的是安全第一，而且南京硅基的产品也是排名前十的信托公司里面收益最高的。外面高收益的产品很多，但毕竟是高收益高风险，这个就看您自己的风险偏好了。', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152397, null, '20190125TEM00000075531', 'jstzhs2_en', '一般问题', null, null, '好的，我稍后安排投资经理给您把地址发过去，您直接导航过来，到了我们去接您。', '2019-01-29 15:17:44', 'test6-huashu2', null, null, null, null, null, false, null, null);
