INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152507, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '这边都是随机拨打的，如果不巧打扰到您，非常抱歉了。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152508, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '都是积分通道，每笔刷卡都有积分的。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152509, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '机器会以快递形式邮寄给您，稍后我们会加您微信，您留意通过下，把您的收货地址发过来，我们今天就可以给您安排发货了。具体咱们微信上聊！好吧？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152510, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '这个您可以放心哦，这个是正常的交易，只不过你既是刷卡用户，又是商户，所以他不是套现，请你放心！银行鼓励用户办理自己的POS的，您看是否需要免费领取一台呢？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152511, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '硅语是正规一清机，您可以在人民银行官方网站上查询到我们的支付牌照。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152512, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, 'POS机邮寄给您后，快递员会暂时收取您120元的押金，您收到机器后，激活注册的当月累计刷满1000元，联系微信客服，会返回您120元的押金，机器是免费送您使用的。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152513, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '第三方支付是指与银行银联签约，并具备一定实力和信誉保障的第三方独立机构提供的交易支付平台。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152514, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '您不要误会，收押金是为了防止个别客户收到机子后不绑定激活，享受不到我们的优惠政策又造成公司损失。激活注册并在当月累计刷满1000元，押金绝对会全额退还给您的。您刷满后联系微信客服就可以了。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152515, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '我们与银行属于合作关系，同属银联。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152516, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '我们的pos机除了可刷卡套现，还可以申请贷款、信用卡，这些功能其他机器都不具备的，多一台pos机，对于您账单的美化也是比较好的，提额很快。建议您可以再备一部。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152517, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '一清是银行或支付公司直接对接客户，资金只进行一次清算。二清是银行或支付公司结算款支付给一个人或一家公司，再由这家公司或个人结算给客户，资金进行二次清算，存在资金被操控或跑路的风险。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152518, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '我们硅基是有支付牌照，资金一清，产品都已通过银联过检报备，安全合规，费率低到账快，而且都是落地省内实体商户，走的都是积分通道，而且还支持办理信用卡和贷款的，功能相对于其他品牌来说更全面', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152519, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '不会的，信息都是直接提交给支付公司，进行加密储存的。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152520, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '您要先绑定一张储蓄卡作为您的提款账户，是你自己名下的银行卡，什么银行卡方便入帐，就绑什么银行到帐收款，刷的卡也没有限制，钱直接到账您绑定的提款账户，秒到账。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152521, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '刷卡套现费率是0.55%，单笔提现秒到3元，刷1万块是55元，2万块是110元，是现在市场最低费率,请问你需要免费领取一台吗？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152522, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '如果您暂时没有刷卡需求，放在那里就可以了，不会产生任何的费用，等有需求的时候您再用起来就行了。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152523, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '如果您使用过类似的支付产品，应该了解目前市面上的产品多是扫码支付，刷多了会封卡降额的，而且很不稳定，只能刷小额度，万一您急需资金周转，这样会耽误您使用的。咱们的费率是手机pos机里面最低费率了。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152524, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '信用卡申请的话，填写一下资料，我们和银行都有合作，走的是快速通道的，通过率会比其他平台高很多的，稍后我安排客户经理跟您联系下，好吧？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152525, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '每笔都是直接秒到的，机器单笔最高刷5w，日限额20w，秒到账，超过秒到额度的，第二个工作日下午到账。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152526, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, 'pos机是全国通用的，商户3-6个小时变化一次，可自选商户定位，都是酒店百货类实体优质商户，没有优惠类商户，对卡都是比较好的，全国10万家商户以上，商户不重复。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152527, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '我们是南京硅基智能科技有限公司，注册资金1.2亿，是由央行颁发的具备收单资格的第三方支付公司，拥有合法支付牌照，您可在人民银行官网查询到信息的，持牌7年了，稳定可靠，您可以放心。同时我们还有硅信、硅语等知名牌子的POS机，我们公司在南京软件大道这边，交通很方便的，欢迎你到公司来了解业务。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152528, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '我们产品名字叫硅语，是由硅基公司出品的一清手机pos机，蓝牙机器，磁条卡芯片卡都都可以刷，养卡套现、贷款、代还信用卡、贷款都可以的。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152529, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '您这边不还款的话，会产生逾期费用的，这个对您以后再次贷款会产生影响的。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152530, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '您可以联系微信客服经理取消秒到功能，取消后第二个工作日到账。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152531, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, 'POS机是个人移动支付终端，就是给个人使用的，而且您刷的每笔消费都是真实存在的，刷卡商户也都是本地实体商户，每三到六个小时自动变更的，不会对您的卡造成任何影响，经常使用还会美化账单，养卡提额的。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152532, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '您可以拆外包装查收验货的，但不能试用，因为机器里有sn码是定价用的，一旦试用再退货，机器就报废了，影响我们二次销售的。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152533, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '您可以随时与咱们微信客服联系，报您的终端号或注册手机号，公司会为您快速查询，并作出合理解释，并会督促支付公司尽快解决问题。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152534, null, '20190125TEM00000107231', 'xmposj_en', '一般问题', null, null, '用有效期内的有效身份证信息才可以注册。', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152535, null, '20190125TEM00000107231', 'xmposj_en', '拒绝', null, null, '其实，了解看看对您来说也没有坏处的啊。像您以后资金周转啊，贷款还信用卡啊，都可以派上用场的，谁没有个急需呢，说对不对？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152536, null, '20190125TEM00000107231', 'xmposj_en', '流程2_1', null, null, '好的，为您简单介绍下产品，我们公司POS机已通过银联报备，安全合规；带有银联标志的卡都可刷；商业收款、养卡套现、贷款都可以；另享信用卡快速申请通道，还可以代还信用卡账单呢。您要不要考虑下？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152537, null, '20190125TEM00000107231', 'xmposj_en', '流程2_2', null, null, '费率也是市场上最低的，具体要看您是使用办理哪种业务，您看您是需要套现，还是贷款呢，我来详细为您介绍下，好吧？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152538, null, '20190125TEM00000107231', 'xmposj_en', '开场白', null, null, '您好，我是POS机客服人员，现在只要您有信用卡，我们就送套现秒到POS机，请问您需要吗？', '2019-01-29 15:25:12', 'test6-huashu2', null, null, null, null, null, false, null, null);
