INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152890, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '您找的兼职会计还是财务公司呀？有没有签合同呀。如果没签您可以考虑下我们，俗话说货比三家嘛。这样您也放心点呀。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
