INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152896, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '我们的服务包括企业利润情况、纳税情况、资金情况、国地税报到等等，我们有会计助理为您整理粘贴票据，有总账会计为您记账报税，提供财税咨询服务,您就放心吧。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152897, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '是的我们就在南京雨花台区软件大道', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152898, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '这个就比较多了,首先我们是专业的财税公司,我公司所用的代账软件是全国最新、最安全的，能做好税务风险预案，服务的性价比是非常高的。然后我们这边无论是会计还是销售财税顾问都是一对一服务,有专业的财税服务团队给您提供全方位的财税咨询和财务规划服务。更多的我可以安排相关人员与您联系。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152899, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '这个当然没问题呀，稍后我安排同事与您联系。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152900, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '其实您正在银行开户并不影响我们的合作，而且我们现在还有优惠活动，可以免费帮您做国地税报道，您银行开户许可证一拿到，我们就可以帮您办理国地税报到，还有签订三方协议，这样也不耽误您开展业务，您说是吧？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152901, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '老板，因为我是一名客服专员，具体情况还是让我的同事跟您详谈', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152902, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '是这样啊，因为只要公司成立就需要报税，就有业务，就需要做账、税收筹划、企业工商年检、所得税汇算清缴等，这些问题必须有一个专业的财务人员才可以解决，我们就是专门提供这类服务的。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152903, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '老板，交国地税的话，直接存钱到公司基本账户扣就好的。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152904, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '现在银行开户比较费时，如果您自己去办理的话，有的银行还需要实地核查，快的话十几天，慢的话一两个月。我们公司有很多合作的银行，如果我们帮您做预约，速度比较块，可以节省您的时间，这样也不耽误您开展业务，您说是吧？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152905, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '老板，我微信号跟电话同号是：18620636425。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152906, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '嗯，执照没拿到并不影响我们的合作，而且我们现在还有优惠活动，可以直到您后期做银行开户，还可以免费帮您做国地税报道，免费做三方协议，您要不考虑下？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152907, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '老板是这样，给您来电也是希望帮您解决问题，所以想深入了解您这边的情况才能更好的帮助您呐。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152908, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '可以的，只要配合地址核查就行，如果您有这方面的需求，稍后我安排一名专业的财务经理给您最专业的解答吧？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152909, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '提供租赁合同和身份证就可以了，稍后我会让我们专业的税务顾问再跟您详细说明的。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152910, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '那打扰您了,祝您生活愉快', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152911, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '老板，具体的收费要看您选择的服务项目，您这边是明天上午还是下午有时间，我安排主管具体跟出方案。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152912, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '您好，老板，我们做这行有10多年了，经营丰富，很多疑难杂症都可以处理，您这边具体的情况不太了解，我这边安排人过来了解情况给您出方案，您看可以吧！', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152913, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '有朋友帮您做也很好，可能您比较放心。但是是这样的，我们遇到好多客户，之前也是让朋友记账报税，后来出现一些问题，漏报税造成两三千的罚款，损失都得自己承担，最后还是跟我们合作了。而且我们公司不仅是记账报税，还为您提供财税咨询服务呢,出现问题我们全权负责，您要不要考虑下呢？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152914, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '其实您现在自己做零申报，我特别能理解，但是我觉得吧，您注册公司肯定是想把公司发展壮大的，我们也希望您公司越做越大。但是您现在零申报的话，其实对您的企业埋下了一个很大的财税风险。如果您长期零申报被税务关注到，第一次会找您约谈，第二次就是强制注销公司了。所以我建议您以后还是不要做零申报比较好呢。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152915, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '这个您不用担心的，我们本身的客户就覆盖南京各区。您可以放心交给我们。', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152916, null, '20190128TEM00000230323', 'gzcccs_en', '一般问题', null, null, '要看您是选哪个区的，要求比较多，具体情况我让专业的财税专员稍后给您回电话好吗？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152917, null, '20190128TEM00000230323', 'gzcccs_en', '拒绝', null, null, '没关系的，您可以考虑一下，我们之间也许有合作的机会呢？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152918, null, '20190128TEM00000230323', 'gzcccs_en', '流程2_1', null, null, '我们是互联网+的形式，我们有国家税务总局认可的自主研发的记账软件，您可以通过手机客户端，随时查看您的账目信息，一目了然，清晰易懂，您看您这边有需要吗？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152919, null, '20190128TEM00000230323', 'gzcccs_en', '流程2_2', null, null, '在本月啊，我们是有优惠活动的，将会对签约客户进行一个基础的财务培训，可以帮助企业了解税务知识和办事流程。具体的，咱们再当面谈一下，好吧？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152920, null, '20190128TEM00000230323', 'gzcccs_en', '开场白', null, null, '喂，您好，（停顿二秒这样）我们是南京硅基智能科技有限公司，专业提供工商注册、代理记账、税务申报等服务。您有兴趣了解下吗？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152921, null, '20190128TEM00000230323', 'gzcccs_en', '解释开场白', null, null, '是这样的，我公司成立至今10年为上万家中小微企业提供了专业的工商注册、代理记账、财税顾问服务，可以给您简单介绍一下吗？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152922, null, '20190128TEM00000230323', 'gzcccs_en', '出错', null, null, '不好意思，可能信号太差了，我这边没有声音，下次再联系吧，拜拜！', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (152923, null, '20190128TEM00000230323', 'gzcccs_en', '邀约', null, null, '好的，那稍后我让我们财税顾问联系您，约一下具体的面谈时间，可以吗？', '2019-01-29 15:56:15', 'test6-huashu2', null, null, null, null, null, false, null, null);
