INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153247, null, '20190128TEM00000240632', 'xasdhb_en', '结束_在忙', null, null, '那等您方便的时候再联系吧，祝您生活愉快，再见！', '2019-01-29 18:39:16', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153248, null, '20190128TEM00000240632', 'xasdhb_en', '流程21', null, null, '好的，针对目前洗车行水费昂贵，城管环保督查越来越严的问题，我们公司自主研发的这款全自动污水处理设备可以做到污水循环利用零排放、大大节省水费，而且无需加药层层过滤，您自用的话方便实惠，做我们的代理的话呢也能有不错的收益。您看有没有兴趣合作？', '2019-01-29 18:39:16', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153249, null, '20190128TEM00000240632', 'xasdhb_en', '结束_未匹配', null, null, '抱歉，我这里信号不太好，要不稍后再联系您吧，今天就先这样了，再见！', '2019-01-29 18:39:16', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153250, null, '20190129TEM00000276938', 'ahltadxf_en', '未匹配响应', null, null, '不好意思哦，刚没听清，您再说一遍好吗？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153251, null, '20190129TEM00000276938', 'ahltadxf_en', '未匹配响应', null, null, '啊，您刚说什么？ 能说的慢点吗？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153252, null, '20190129TEM00000276938', 'ahltadxf_en', '结束', null, null, '好的，感谢您对我们的工作的支持和配合，祝您生活愉快，再见！', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153253, null, '20190129TEM00000276938', 'ahltadxf_en', '结束', null, null, '那打扰您了,祝您生活愉快，再见！', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153254, null, '20190129TEM00000276938', 'ahltadxf_en', '强制结束', null, null, '您看我这边也是新来的，您的问题一时也无法准确答复您。稍后让我们专业的客户经理给您来电为您解答吧。那今天咱们就先这样吧，祝您生活愉快，再见', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153255, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '那你们一般什么时候有时间，有没有开会的时候，人员比较集中，我们安排一下过来，好吧', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153256, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '那麻烦您报一下他的电话号给我，我好和他联系一下，您看可以吗？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153257, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '办公室对外的电话有什么不方便的，我们的工作要落实到位，对你们公司和员工都是有利的，要不我们就直接过去，您看可以吗？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153258, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '我们是专业从事消防安全培训的机构，省消防协会的理事单位。这次是义务宣传，到时候您只要组织公司工作人员，义务学习下就好，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153259, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '我们是公益性的，我们的活动经费部分是政府拨款，不收取单位任何费用的。主要就是教大家一些高楼层宇逃生自救的能力，以及加强一下预防意识，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153260, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '我们这边是免费做消防宣传的，公益性的，我们电话都有录音的，我们只是通知您，希望您这边义务配合我们工作，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153261, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '我姓冯，是江苏消防协会普安宣教中心行政办公室的，您叫我冯老师就可以了。', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153262, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '具体内容稍后会有我们行政人员给您电话跟您详聊，您看可以吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153263, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '怎么会呢，我们江苏消防协会普安宣教中心的客服在与客户沟通的过程中，使用的话术是要统一的，为的就是能给您带来最好的客服体验。', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153264, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '我们系统都有登记的，你们今年还没有做过消防培训，都是看得到的，我们还是安排消防教员过来做一下宣讲，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153265, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '好的，稍后呢我让行政人员和你对接一下，你们互相留个让他和你沟通好吧！', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153266, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '我们培训的内容的主要是火灾中自我保护逃生和自救能力，法律法规的普及，办公室防火用电注意事项，电话里面也讲不清楚，要不我加您微信在跟您具体沟通好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153267, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '是的，能参加的都要参加，或者安排公司和各部门主管领导，骨干人员参与学习，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153268, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '关系好归关系好，只能说您人脉广，但是一旦发生火灾事故造成人员伤亡以及财产损失，我相信这个再好的关系和朋友也会很难帮您处理的您说是吧。', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153269, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '现在全市的消防宣传工作都是由我们在做的，队里面现在主要负责器材的检查，火场的救援和防火排查的验收，队里对我们的日常工作是监督指导的，如果没有问题，我就安排行政人员给您电话对接具体消防工作，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153270, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '您也知道，消防器材是我们救命的工具，发生意外时我们都离不开它，我们只是在培训的最后几分钟教大家怎么样使用产品，大家会使用就可以了，我们不会强制性要求大家买，根据个人需求就行，主要对防控知识的宣讲和安全意识的培养才是我们的主要目的，您说是吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153271, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '物业只是负责整个大楼消防设施的维保和检查工作，个人的安全意识还是要靠单位自己组织。你们安排一下，我们过来宣讲一下，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153272, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '领导，您应该知道，意外无处不在，万一意外发生，第一您的经济上是一大笔损失，第二这边还要负相应的法律责任，这个消防安全是防范于未然的这个您肯定是知道的对吧', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153273, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '是这样，我们会安排专业的消防教官去您单位进行讲座并普及消防知识，稍后我这边让我们的消防主任给您回一个电话，详细沟通一下好吧。', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153274, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '安全法规定所有单位一年要开展2次以上的消防培训，我们现在是联系下个季度的消防培训，您看下半年什么时候再安排，我们到时候再联系你。如果没有问题，我就安排办公室主任给您电话对接具体的培训时间，好吧?', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153275, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '领导你们年年都听他们培训，下面员工都听的不想听了，可以尝试换我们来宣讲，员工们更能从中吸取不一样的防控知识，您也可以多一个选择，这次就我们过来讲好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153276, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '哦，好的', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153277, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '不好意思，我这边信号不好，这样，稍后让行政人员给您电话跟您详聊，您看可以吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153278, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '可以把员工和中层管理人员分开培训，先组织中层管理人员和办公室人员开展，他们听了再传达给下面员工，领导重视了，下面员工才能更重视，如果没有问题，我就安排办公室主任给您电话对接具体的培训时间，好吧？', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153279, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '这边只需要把员工集中在一起，然后我们这边会义务教学以及消防演练。提高员工的防范意识，以及降低企业的生命财产风险。', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153280, null, '20190129TEM00000276938', 'ahltadxf_en', '一般问题', null, null, '领导，消防安全本来重在预防，知识我们每个人都懂，我们缺少的是在意外发生时的应变能力，我们这边同时也会给企业做消防演练，当意外来临时把企业的生命财产风险降至最低。', '2019-01-29 18:40:20', 'test6-huashu2', null, null, null, null, null, false, null, null);
