INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153354, null, '20190128TEM00000208012', 'lwdsw_en', '一般问题', null, null, '《本草纲目》中记载着鹿胶具有补气补血、美容养颜、调节内分泌、改善睡眠、增强免疫力等功效。对于现代女性常见的皮肤粗糙、缺少光泽弹性、月经不调、手脚冰凉、畏寒怕冷、免疫力低下等问题，效果尤为突出，而且我们公司研发的鹿胶糕选用纯中药制作，全程无防腐剂添加，更天然更营养更健康。', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153355, null, '20190128TEM00000208012', 'lwdsw_en', '拒绝', null, null, '您别拒绝的这么快嘛。鹿胶是中医传统药的药食同源滋补品，已经有2800年的历史了，对女性调理生理健康具有明显的疗效。而且现在公司推出优惠活动，真的很划算。临近佳节，您也可以为您的母亲、女性朋友和客户选为馈赠的礼物，你可以再考虑一下呢?', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153356, null, '20190128TEM00000208012', 'lwdsw_en', '开场白', null, null, '您好，我是南京硅基公司的，临近佳节，我们现在推出了一款比阿胶还要好的滋补品-鹿胶，您需要了解一下吗？', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
