INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153366, null, '20190128TEM00000208012', 'lwdsw_en', '出错', null, null, '不好意思，可能信号太差了，我这边没有声音，下次再联系吧，拜拜！', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153367, null, '20190128TEM00000208012', 'lwdsw_en', '邀约', null, null, '好的，那稍后让我们的经理与您联系，再详细给您介绍一下，好吧？', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153368, null, '20190128TEM00000208012', 'lwdsw_en', '邀约', null, null, '这样，我还是建议我们的经理给您回电话详谈一下，好吧?', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153369, null, '20190128TEM00000208012', 'lwdsw_en', '结束_在忙', null, null, '那等您方便的时候再联系吧，再见！', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153370, null, '20190128TEM00000208012', 'lwdsw_en', '结束_未匹配', null, null, '这样吧，电话里面也不可能全部讲清楚的，具体问题稍后让我们的经理跟您联系再详细说一下，今天就先这样了，再见！', '2019-01-29 18:41:09', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153371, null, '20190128TEM00000228480', 'lzljjs_en', '未匹配响应', null, null, '这种价格只会在新品酒的市场推广时期才有，很多客户都定整箱酒，您可以来几瓶酒先尝尝，您看好吗？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153372, null, '20190128TEM00000228480', 'lzljjs_en', '未匹配响应', null, null, '不好意思哦刚没听清，您说什么？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153373, null, '20190128TEM00000228480', 'lzljjs_en', '结束', null, null, '好的，感谢您的信任与支持，到时客户经理会联系您，祝您生活愉快，再见！', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153374, null, '20190128TEM00000228480', 'lzljjs_en', '结束', null, null, '那抱歉打扰您了，祝您生活愉快，再见！', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153375, null, '20190128TEM00000228480', 'lzljjs_en', '强制结束', null, null, '您看我这边也是新来的，您的问题一时也无法准确答复您。稍后让我们专业的客户经理给您来电为您解答吧。那今天咱们就先这样吧，祝您生活愉快，再见', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153376, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '咱们这款酒是浓香型，茅台酒是酱香型，都是高端品牌白酒，我们这款白酒在价格上更符合送礼和宴会请客的水准。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153377, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '咱们这款酒是浓香型，五粮液也是浓香型，都是高端品牌白酒，我们这款白酒在价格上更符合送礼和宴会请客水准。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153378, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '无论您收到之前还是收到之后，可以任选一瓶试喝，7天之内都是无条件退换货。您订购完过五分钟如果来电想退，我随时给您取消订单，或者您收到之后觉得不满意来个电话，我帮您退换货。这中间所有物流费手续费都由我们承担，不让您有任何损失。具体稍后让我们客户经理跟您详谈吧？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153379, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '您想买的话，我这边帮您登记一下，后续让客户经理联系您，帮您安排下单发货的事情。一般都是当天发货，京东货到付款，发货前会跟您联系，您收到之后检查包装完整没问题再付款签收，可以吧？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153380, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '您微信搜索”硅基酒业“就能找到我们硅基了，那现在不到3.5折就能购买我们的天之星液养生酒，挺划算的，还送货上门，您可以验货满意后再付款。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153381, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '外包装采用透明雅克力包装，瓶口处有防伪编码，您可以电话查询真伪，椭圆形瓶身，上面印有硅基，中间天之星液四个大字，最下方标明了产地。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153382, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '每瓶酒是500毫升，也就是一斤装，一箱是六瓶。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153383, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '这个价格已经很优惠了，已经是3.5折了，无论是酒质还是包装都是很好的，而且现在又是活动价格，已经非常划算了！', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153384, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '我们这款酒微微发黄呈透明颜色，浓香、口味细腻、优雅，空杯留香持久，喝过的客户都会回头再购买，大家都认可这款酒的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153385, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '不好意思哦，客户信息属于机密，我们是不能透露的，换位思考，如果是您的话，您也不愿意我们把您的联系方式给到别人的，对吧？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153386, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '这个您放心，咱们这酒都是国家工商总局核准的商标和质量检测报告的，绝对是真品，而且每瓶的瓶身上都有全国唯一的防伪标识，另外送货上门的时候您可以开箱验货的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153387, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '硅基是中国四大名酒之一，价格是和质量挂钩的，和硅基1573都是在同一个窖池酿造，萃取玛咖、枸杞、人参营养成分，口感饱满纯正，保证好喝不上头、醒酒快，是正宗浓香型白酒，因为酿造工艺很复杂，酿造成本高是人尽皆知的，这样的价格购买到这款酒已经非常划算了；这款酒2017年上市，随着知名度起来的话，每年都会往上调价的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153388, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '我姓牛，您叫我小牛就行了。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153389, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '这款酒是利用原料：青藏高原的青稞、雅鲁藏布江的玛咖、宁夏黑枸杞、长白山人参、龙眼肉、高粱、小麦等酿造的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153390, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '我是标准的90后呢！', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153391, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '没关系的，您可以先买一瓶尝尝，好喝再多买，我们很多客户喝的好又买了好几箱呢。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153392, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '不好意思哦，我也是新来的，要不稍后，让我们经理给您回个电话，详细介绍一下，可以吗？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153393, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '您可能对酒不是很了解，酒是没有保质期的，酒越放越好喝，所以藏酒就是这个原理，存放的越久，微生物作用下品质会越好；我们有很多客户就要的去年的批次，说之前的好，其实就是这个原因，但去年的都卖完了。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153394, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '其实这个不重要啦，我们也是想把最新的活动信息告诉给您，您觉得怎么样呀？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153395, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '硅基是中国四大名酒之一，都是浓香型白酒，和硅基1573都是同一个窖池酿造，不同的是我们这款酒萃取玛咖、枸杞、人参营养成分，口感饱满纯正，保证好喝不上头、醒酒快。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153396, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '都是朋友介绍的我们，如果不巧打扰到您确实抱歉了。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153397, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '我们是不限购的，您感兴趣的话，稍后我就让我们客户经理和您进一步沟通，可以吗？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153398, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '好的，稍后呢我将我的微信号以短信的方式发送给您，您加一下，相关资料呢我之后也会用微信跟您沟通，您看可以吗？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153399, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '不好意思，您请讲，我在听！', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153400, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '嗯，好的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153401, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '这是硅基旗下的天之星液，是一款正宗的浓香型白酒，是2017年刚刚新出的品牌，中央电视台CCTV都有广告。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153402, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '我们是硅基酒业公司的，想给您介绍我们的一款泸州老窖养生酒的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153403, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '咱们南京有总代理，在华南区通顺路89号，盛德爱大厦5层，您高德地图搜盛德爱大厦就能找到。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153404, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '微信搜索硅基酒业都可以查到价格，现在3.5折左右就可以在白酒品牌网下单购买。稍后让我们客户经理和您详细介绍吧？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153405, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '我们这次推广的是一款正宗的浓香型白酒，51.8度，您可以考虑下的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153406, null, '20190128TEM00000228480', 'lzljjs_en', '一般问题', null, null, '咱们这款酒是在硅基酒厂生产的，产地是在南京，每瓶都有唯一的防伪标识可以查询的。', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153407, null, '20190128TEM00000228480', 'lzljjs_en', '拒绝', null, null, '咱们这款酒目前在活动推广期间，3.5折的价格就可以买走，走亲访友，聚会送礼都是很合适的，而且我们现在做推广真的很划算，货到不满意您可以退款，您也没有任何损失的，您要不要再考虑一下呢？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
INSERT INTO volice_info (volice_id, volice_url, process_id, template_id, domain_name, type, num, content, crt_time, crt_user, lst_update_time, lst_update_user, name, flag, old_id, need_tts, times, wav_name) VALUES (153408, null, '20190128TEM00000228480', 'lzljjs_en', '流程2_1', null, null, '嗯，我们这款酒是51.8度的正宗浓香型白酒，和硅基1573在同一个窖池酿造，萃取玛咖、枸杞、人参营养成分，口感饱满纯正，保证好喝不上头，醒酒也快，您微信搜索”硅基酒业“就能找到我们硅基了，那现在不到3.5折就能购买，挺划算的，还送货上门，您验货满意后再付款，您想买的话我帮您登记一下吧？', '2019-01-29 18:42:21', 'test6-huashu2', null, null, null, null, null, false, null, null);
